package info.gogou.gogou.payment;public class PaymentResult {	public enum PaymentStatus {		SUCCESS,        PROCESSING,		FAILURE	}    private PaymentStatus mStatus;	private String mResult;	private String mMemo;    @Override	public String toString() {		return "resultStatus={" + mStatus + "};memo={" + mMemo				+ "};result={" + mResult + "}";	}    public PaymentStatus getStatus() {        return mStatus;    }    public void setStatus(PaymentStatus status) {        this.mStatus = status;    }    public String getResult() {        return mResult;    }    public void setResult(String result) {        this.mResult = result;    }    public String getMemo() {        return mMemo;    }    public void setMemo(String memo) {        this.mMemo = memo;    }}